### Overview
Tried to fix the `ByteBufferBackingArray` ‚ö†Ô∏è which is basically is avoid us to access the `.array()` because there is the possibility that it could be direct ByteBuffer (built using off-heap directly mapped to memory) too.

### Proposed Changes
To avoid this situation, I'm checking first if `buffer.hasArray()` which checks it doesn't have a `null` byte array, and if it's not a read-only ByteBuffer(basically checking if its a heap buffer) 

### Problem
Even after doing what is mentioned above, that warning still exists. But as soon as I invoke the `buffer.arrayOffset()`(which might throw an exception if its a heap buffer) before calling `buffer.array()` the warning is gone

```
if(buffer.hasArray()){ // It's checking if byte array is not  null and not read only.
try {
      buffer.arrayOffset(); // Also check byte array in ByteBuffer is not null and its not readomly.
    } catch (ReadOnlyBufferException e) {
      return null;
    }
// ..... further code
}
```

and if I don't call the `buffer.arrayOffset()` warning exists.

Thanks for the help in advance üôá‚Äç‚ôÇÔ∏è

### Overview
[EqualsGetClass](https://errorprone.info/bugpattern/EqualsGetClass) - Prefer instanceof to getClass when implementing Object#equals.

### Proposed Changes
I've replaced the code snippet below in `equals` method
```
if (o == null || getClass() != o.getClass()) {
       return false;
}
```

to this

```
if (!(o instanceof MethodInfo)) {
        return false;
}
```

**Why**: Because it will not only check for the same class type but also for its's subtypes, and this is what warning trying to solve.
**Note**: Even if a class is final still warning suggests using the `instanceof` comparison operator.
